import React from "react";

export default props => {
    const rows = props.lancamentos.map(e => {
        return (
            <tr key={e.id}>
                <td>{e.descricao}</td>
                <td>{e.valor}</td>
                <td>{e.tipo}</td>
                <td>{e.data}</td>
                <td>{e.conta}</td>
                <td>{e.cartao}</td>
                <td>{e.situacao}</td>
                <td>
                    <div className="d-flex justify-content-center align-items-center mt-3" >
                        <button type="button" className="btn btn-success" style={{ marginRight: "5px" }} >Editar</button>
                        <button type="button" className="btn btn-danger">Deletar</button>
                    </div>
                </td>
            </tr>
        );
    });

    return (
        <table className="table table-hover">
            <thead>
                <tr>
                    <th scope="col">Descrição</th>
                    <th scope="col">Valor</th>
                    <th scope="col">Tipo</th>
                    <th scope="col">Data</th>
                    <th scope="col">Conta</th>
                    <th scope="col">Cartão</th>
                    <th scope="col">Status</th>
                    <th scope="col" className="mx-auto">Ações</th>
                </tr>
            </thead>
            <tbody>{rows}</tbody>
        </table>
    );
}
